export default function Product(){
    //const products = ["Laptop", "Modem", "Router", "Mouse"];
    const products = [
        {
            id: 1,
            name : "Laptop",
            price: 400,
        },
        {
            id: 2,
            name : "Mouse",
            price: 50,
        },
        {
            id: 3,
            name : "Router",
            price: 100,
        },
        {
            id: 4,
            name : "Laptop",
            price: 900,
        },
    ]
    const productList = products.map((product) => (
        <h3>{product.name}</h3>
    ));
    return <div>{productList}</div>
}
